import "./SubEmbedControls.css"
import {useContext} from 'react'
import { getCSSVariable, isDarkMode } from "./Utilities.js"
import { isThemeDark } from "./Utilities.js";
import { ThemeContext } from './ThemeContext';
export const SubEmbeds = Object.freeze({
  CHAT: 'CHAT',
  BRACKET: 'BRACKET',
  MAP: 'MAP',
});


export const SubEmbedControls = ({controlTypes = [SubEmbeds.CHAT, SubEmbeds.BRACKET, SubEmbeds.MAP], onPressControlType, selectedControlType}) => {
  // const { theme } = useContext(ThemeContext);
  // const isDark = isThemeDark(theme);
  const isDark = true;
  const unselectedColor = isDark ? "#bbbbbb" : "#343434"
  const selectedColor = isDark ? "#eeeeee" : "#141414"
  const iconSize = "42px"
  return <div className = "subEmbedControls">
    {
      controlTypes.map(controlType => {
        switch (controlType) {
          case SubEmbeds.CHAT: {
            const selected = controlType == selectedControlType
            const onClick = () => onPressControlType(selected ? "" : controlType)
            const subEmbedClass = selected ? "subEmbedControl" : "subEmbedControl subEmbedSelected" 
            const controlColor = selected ? selectedColor : unselectedColor
            return <div class={subEmbedClass} onClick={onClick}>
              <ChatBubble width={iconSize} height={iconSize} color={controlColor} color2="01010100"/>
            </div>
          }
          case SubEmbeds.BRACKET: {
            const selected = controlType == selectedControlType
            const onClick = () => onPressControlType(controlType == selectedControlType ? "" : controlType)
            const subEmbedClass = controlType == selectedControlType ? "subEmbedControl" : "subEmbedControl subEmbedSelected" 
            const controlColor = selected ? selectedColor : unselectedColor
            return <div class={subEmbedClass} onClick={onClick}>
              <BracketIcon width={iconSize} height={iconSize} color={controlColor} color2="01010100"/>
            </div>
          }
          case SubEmbeds.MAP: {
            const selected = controlType == selectedControlType
            const onClick = () => onPressControlType(controlType == selectedControlType ? "" : controlType)
            const subEmbedClass = controlType == selectedControlType ? "subEmbedControl" : "subEmbedControl subEmbedSelected" 
            const controlColor = selected ? selectedColor : unselectedColor
            return <div class={subEmbedClass} onClick={onClick}>
              <GlobeIcon width={iconSize} height={iconSize} color={controlColor} color2="01010100"/>
            </div>
          }
        }
      })
    }
  </div>

}
